      \u0275\u0275elementStart(6, "section", 2)(7, "div", 1)(8, "div", 3)(9, "div", 4)(10, "h2");
      \u0275\u0275text(11, "Az \xDAj \xC9let Baptista Gy\xFClekezet");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(12, "p", 5);
      \u0275\u0275text(13, " Gy\xF6ngy\xF6s\xF6n tal\xE1lhat\xF3 gy\xFClekezet\xFCnk egy szeretetteljes k\xF6z\xF6ss\xE9g, ahol minden ember megtal\xE1lhatja hely\xE9t Isten csal\xE1dj\xE1ban. Hisz\xFCnk abban, hogy J\xE9zus Krisztus mindenkinek szabads\xE1got \xE9s \xFAj \xE9letet k\xEDn\xE1l. ");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(14, "div", 6)(15, "div", 7)(16, "div", 8);
      \u0275\u0275text(17, "\u{1F4D6}");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(18, "h4");
      \u0275\u0275text(19, "Bibliai tan\xEDt\xE1s");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(20, "p");
      \u0275\u0275text(21, "\xC9let\xFCnk alapja az Isten Ig\xE9je, amelyet komolyan vesz\xFCnk \xE9s gyakorlatban is alkalmazunk.");
      \u0275\u0275elementEnd()();
      \u0275\u0275elementStart(22, "div", 7)(23, "div", 8);
      \u0275\u0275text(24, "\u2764\uFE0F");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(25, "h4");
      \u0275\u0275text(26, "Szeretet");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(27, "p");
      \u0275\u0275text(28, "Isten szeretete motiv\xE1l minket arra, hogy egym\xE1st \xE9s k\xF6z\xF6ss\xE9g\xFCnket szolg\xE1ljuk.");
      \u0275\u0275elementEnd()();
      \u0275\u0275elementStart(29, "div", 7)(30, "div", 8);
      \u0275\u0275text(31, "\u{1F91D}");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(32, "h4");
      \u0275\u0275text(33, "K\xF6z\xF6ss\xE9g");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(34, "p");
      \u0275\u0275text(35, "Hisz\xFCnk a k\xF6z\xF6ss\xE9g erej\xE9ben \xE9s abban, hogy egy\xFCtt t\xF6bbek vagyunk.");
      \u0275\u0275elementEnd()();
      \u0275\u0275elementStart(36, "div", 7)(37, "div", 8);
      \u0275\u0275text(38, "\u{1F64F}");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(39, "h4");
      \u0275\u0275text(40, "Ima");
      \u0275\u0275elementEnd();
      \u0275\u0275elementStart(41, "p");
      \u0275\u0275text(42, "Az ima az alapja kapcsolatunknak Istennel \xE9s egym\xE1ssal val\xF3 k\xF6z\xF6ss\xE9g\xFCnknek.");
      \u0275\u0275elementEnd()()()()()()();
      \u0275\u0275elementStart(43, "section", 9)(44, "div", 1)(45, "div", 10)(46, "h2");
