      \u0275\u0275elementStart(55, "p");
      \u0275\u0275text(56, "Kisebb csal\xE1di k\xF6rben kezd\u0151d\xF6tt a k\xF6z\xF6s bibliaolvas\xE1s \xE9s ima Gy\xF6ngy\xF6s\xF6n.");
      \u0275\u0275elementEnd()()();
      \u0275\u0275elementStart(57, "div", 12)(58, "div", 13);
